rk Brotherhood\n – Daedric War\n – A Lost Legacy\n – Season of the Dragon\n – Dark Heart of Skyrim"},[3]={name="ESO: Групповой контент",id=string.format("%s %s|t26:26:%s|t %s|t26:26:%s|t %s|t26:26:%s|t / |t26:26:%s|t\n\n%s\n\n%s","The Group section includes the majority of instanced Group Content to-date.","Dungeons: ","/esoui/art/icons/poi/poi_groupinstance_complete.dds","Trials: ","/esoui/art/icons/poi/poi_raiddungeon_complete.dds","Arenas: ","/esoui/art/icons/poi/poi_groupinstance_complete.dds","/esoui/art/icons/poi/poi_raiddungeon_complete.dds","There are normal, veteran, and occasionally hard-mode versions of the content, but with the exception of Maelstrom Arena (which only requires the normal-mode quest), the Guide does not care on which difficulty you complete the quest.","The quests are still tied to the content with which they released. E.G., Maw of Lorkhaj is in Reaper's March, but released with Thieves Guild, so it will be listed under the latter.")}}}TQG.ObjectiveLevelOverview={}TQG.ObjectiveLevelOverview[1]={}TQG.ObjectiveLevelOverview[1][1]={[1]={name="Useful Links",description="Due to the nature of the links, spoilers are more likely the deeper you delve. Be forewarned..."}}TQG.ObjectiveLevelOverview[1][2]={[1]={name="Useful Links",description="Due to the nature of the links, spoilers are more likely the deeper you delve. Be forewarned..."}}TQG.ObjectiveLevelOverview[1][3]={[1]={name="Notes",description="Required group size for the content will vary according to the individuals. Maelstrom Arena is a solo Arena–You will face it's horrors alone.\n\n(As a general rule, Dungeon quests are not repeatable, while Trial quests are repeatable weekly. You will only need to complete them once to register them.)"}}TQG.TopLevelClassic={[1]="0-2: Слияния миров",[2]="1: Альдмерский Доминион",[3]="1: Даггерфольский Ковенант",[4]="1: Эбонхартский Пакт",[5]="1: Гильдия бойцов",[6]="1: Гильдия магов",[7]="2: Хладной Гавани",[8]="3: Краглорн",[9]="x: Сиродил"}TQG.ZoneLe